ut of specification {5V,7V}\')\r\n\r\n    if VF_Bank_3_v < 5 or VF_Bank_3_v > 7:\r\n        print(\'VF_Bank_3_v was out of specification {5V,7V}\')\r\n\r\n    if VF_Bank_4_v < 5 or VF_Bank_4_v > 7:\r\n        print(\'VF_Bank_4_v was out of specification {5V,7V}\')\r\n\r\nTo :\r\n\r\n    if VF_Bank_1_v < 4.5 or VF_Bank_1_v > 7:\r\n        print(\'VF_Bank_1_v was out of specification {4.5V,7V}\')\r\n\r\n    if VF_Bank_2_v < 4.5 or VF_Bank_2_v > 7:\r\n        print(\'VF_Bank_2_v was out of specification {4.5V,7V}\')\r\n\r\n    if VF_Bank_3_v < 4.5 or VF_Bank_3_v > 7:\r\n        print(\'VF_Bank_3_v was out of specification {4.5V,7V}\')\r\n\r\n    if VF_Bank_4_v < 4.5 or VF_Bank_4_v > 7:\r\n        print(\'VF_Bank_4_v was out of specification {4.5V,7V}\')\r\n\r\n \r\n\r\n2.Update overlay logic as below,\r\n2-1.Disable command \"i2cwrite 5 0x30 0x24 1 1 0xFC\"\r\n2-2.Add test logic for auto Diags mode reboot to OS mode. \r\n2-3.Fix test logic ,The test items should test result fail on diags mode and show \"Not OS mode ,Please enter OS mode\".\r\n \r\nPre-validation status: \r\n1. PG/PF Jasper Arming Station can test result Pass.\r\n2.PG/PF Jasper Arming Station can auto Diags mode reboot to OS mode\r\n(For more detail please refer to attached file.)','./upload/042f7f5a6255bea5a075059252c62692.txt,./upload/518953195dcb721b7ab4ab61583ba7da.txt','Diag to OS_Jasper_DLXYL00BMK17_1_20190502120113.txt,OS_Jasper_DLXYL00KMK17_1_20190502120445.txt','10','4','V23.1.2.0'),(226,116,'50','2019-05-03 14:43:23','1.Update F1\'s scripts file \"J4x_riker_arming_v4.py\"  test logic as below,\r\n1-1. Test logic from riker_registers[0x24] = 0x00 change to riker_registers[0x24] = 0xFC\r\n1-2. remove logic\r\n\r\n    if RIKER_VERSION is \'A0\':\r\n        riker_registers[0x24] = 0x00\r\n    if RIKER_VERSION is \'B0\':\r\n        riker_registers[0x24] = 0xFF\r\n\r\n1-3. update logic\r\n\r\nFrom :\r\n\r\n    if VF_Bank_1_v < 5 or VF_Bank_1_v > 7:\r\n        print(\'VF_Bank_1_v was out of specifica