\nT(C) = 24.211324 deg C --> result\n','','','2019-06-21 17:26:58','2019-06-21 13:28:28','3','11','10','8,51',3,'Add new requests',NULL,NULL,'Abby Dong',NULL,'2019-06-24 10:15:20','40','8','54','Normal',NULL,'V23.2.3.1','8'),(242,'8','14',2,7,258,'Please help to add \"Read CPMU C3 Temp (deg C)\" in both PG/PP CT2, details as below:','log:\n[000518C1:3C80012E] :-) camisp --on\ncall pick sensor.\nWARNING: Unable to locate Yonkers patch. Proceeding without patch file\nWARNING: Unable to locate Savage patch. Proceeding without patch file\nRunOn 0 0 30\nCapture buffer allocated at: 0xD6716D580, 0xD671DDD80 of 460800 bytes each with default value of 0x0 width 640 height 480\nPass\n[000518C1:3C80012E] :-) reg select cpmu\nSetting active device to \"cpmu\"\nOK\n[000518C1:3C80012E] :-) reg write 0x1D15 0x00 0x10 0x10 0x00 0x10 0x10\nOK\n[000518C1:3C80012E] :-) reg write 0x4000 0x5A\nOK\n[000518C1:3C80012E] :-) reg read 0x4001 2\n0x4001 => 0x06  //LSB\n0x4002 => 0x1A  //MSB\nOK\n[000518C1:3C80012E] :-) camisp --exit\nRunExit\nPass\n[000518C1:3C80012E] :-) \n\nHow to caculate?\nFormula:\nT(K) = 3380/(LN(R/(10000*EXP(-3380/298.15))))\nT(C) = T(K) - 273.15\n\ncode = MLB(MAN1_RES<11:4>) + LSB(MAN1_RES<3:0>) = 0x1A6\nresult(V) = 0x1A6 * 1.221mV = 515.262mV\nRthm = 515.262mV/50uA = 10305.24ohm\nT(C) = 24.211324 deg C --> result\n','','','2019-06-21 17:26:58','2019-06-21 13:28:28','3','11','10','8,36,11,9,51',3,'Add new requests',NULL,NULL,'Abby Dong',NULL,'2019-06-24 10:15:12','40','8','54','Normal',NULL,NULL,'8'),(243,'11','14',1,7,263,'Update overlay following the lastest CB mapping.','CB Mapping table update below :\nRemove Dark Rack, Jasper Arming, Pearl Arming; Compliance 10 station name is Voyager start from P2; Jasper Test 60 rename to Jasper Test 70; Enable Jasper Test 100 check at GK.\n','','','2019-06-24 14:32:48','2019-06-21 17:39:54','4','10','10','77,17,75,51,10,4,11',4,NULL,'Good Job.','5',NULL,'Lorne Peng','2019-06-24 08:51:46','11','11','45','Normal','2019-06-22 17