# Data for table "station_introduce"
#

/*!40000 ALTER TABLE `station_introduce` DISABLE KEYS */;
INSERT INTO `station_introduce` VALUES (1,'QT0a','Introduction','<p class=\"MsoNormal\"><span>Quick Test 0a (QT0a) is the station between Pre-SWDL and RAT. It mainly tests whether the I/O port can be switched to various modes normally, whether all key functions are normal, whether the internal and external MIC, SPK, and HP can work normally after initialization (including whether the channel can transmit signals normally, and whether the components can work normally. Sound-to-electricity, electro-acoustic conversion, whether it is possible to control sound effect switching through remote keys), etc.</span><span><o:p></o:p></span></p>',0,14),(2,'QT1','Introduction','<p>Mainly test the compass function and its interference degree in other \nsubsystems, as well as the current and voltage of each component in the working \nstate of the unit.the test module includes compass, battery, LCD, camera, \nbacklight, audio, etc, located in the second half of the test process.</p>',0,14),(3,'Magnet-Hall','Introduction','<p>This station simulates the protective sleeve in reality, mainly to measure the \nHall effect sensor, check the distance that the magnet (attached to the motor in \nthe fixture) slowly approaches / away from the Hall effect sensor, and whether \nthe distance when the Hall effect sensor is triggered or released is within the \ngiven range.(Similarly, the test station also needs to use the fixture, which \nwill detect the state of the screen when the protective cover is opened and \nclosed).</p>',0,14),(4,'Magnet-Hall','Calibration section of magnet Hall','<p>Calibration data (verification of the magnetic induction intensity value of \norganic and inorganic stations)<br>Use stage: at the beginning of each \nbuild<br>Storage method: /vault/CalibrationData.txt<br>Reading method: the \ntraversal method is stored in SensorOffsetTable［］<br>How to use: Use 10 machines \nto inspect 10 times and take the average value<br>formula:<br>tempNum = (average \nvalue -1500)/(organic unit value-inorganic unit value)<br>teslaValue (final \nmagnetic pole value) = (tempNum * (inorganic station value-current magnetic pole \nvalue))/12.5</p>',1,14),(5,'Magnet-Hall','Motor section of Magnet-Hall','<p>1： Motor initialization -- &gt; motorinit() function<br>2、 Calculate the \ndistance between motor and machine --- &gt; getpositionsensordistance ()<br>3： \nThe command of moving motor and the end mark -- &gt; movemotorwithcmd ()<br>4： \nInitialize the distance between the motor and the machine --- &gt; \ninitmotorposition ()<br>5： Calculate the distance and angle between the magnet \nand the release table.</p>',2,14),(7,'QT1','Compass module','<p>Also known as the electronic compass, when the current passes through a \nconductor in the magnetic field, the magnetic field will produce a transverse \nLorentz force on the electrons in the conductor, thus causing the charge to \ndeflect. The deflection direction is perpendicular to the current direction and \nthe magnetic field direction, and the positive charge and negative charge \ndeflect in the opposite direction, resulting in voltage difference between the \ntwo ends of the conductor. This voltage difference, also known as Hall voltage, \nis proportional to two factors: the magnitude of the current and the strength of \nthe magnetic field. If the direction of the magnetic field is not perpendicular \nto the conductor, the actual magnetic field is actually a vector component of \nthe original magnetic field. Through two or more mutually perpendicular Hall \nsensors, the measured data can be processed by linear algebra operation, and the \nrelative geomagnetic field parameters of the equipment can be calculated.</p>',2,14),(30,'QT1','Objective','The accuracy of GPS signal will be reduced when it is blocked by terrain and \nobjects. In the high-rise area, the signal validity is about 60%, and the \nterminal can\'t obtain the heading information when the terminal is still. In \niPad, compass is used to effectively compensate the GPS signal to ensure that \nthe signal effective rate reaches 100%, that is, \"no loss of satellite \ndirection\".',1,14),(31,'QT1','The main test module as below:','<p class=\"MsoNormal\"><p><b>Magnetometer Coexistence Testing:</b></p><p><span>Molybdenum is a low noise magnetometer which is sensitive to system level static or electromagnetic interference.&nbsp;Magnetometer coexistence tests were conducted at Qt1 station to assess the effects of various system level interference sources on the noise and offset performance of the sensor.&nbsp;But not all subsystems can be tested correctly, because the machine has been tested in EFI diagnostic test environment.&nbsp;Systems that can be permanently \"turned on\" or run to a specific state should be tested at Qt1 station to assess their impact on magnetometers.&nbsp;The purpose of the test is to identify system level problems that seriously affect the magnetometer output.</span></p><p><b><span>Liquid_Crystal:</span></b></p><p><span>It mainly tests the average value and standard difference of X / Y / Z axis output of magnetometer in 60Hz and 120Hz red / Blue / green screen mode.</span></p><p><b><span>Backlight:</span></b></p><p><span>It mainly tests the average value and standard difference of X / Y / Z axis output of magnetometer under 0Hz and 2047hz backlight.</span></p><p><b><span>Audio:</span></b></p><p><span>Audio is divided into woofers / tweeters. The module tests the output value of magnetometer of high / low frequency loudspeaker in LPM and LNM mode respectively.</span></p><p><b><span>Neon:</span></b></p><p><span>Neon has two lights, neon1 and neon2, and the module tests the two lights in amber_&nbsp;LED and cool_&nbsp;white_&nbsp;LED (cold light), the output value of magnetometer.</span></p><p><b><span>Camera:</span></b></p><p><span>The camera modules tested by Qt1 are mainly front camera / rear camera / Juliet.&nbsp;Test the magnitude of interference to the magnetometer when these cameras are on or off.</span></p><p><b><span>Note:</span></b><span>&nbsp;</span></p><p><span>charge, WiFi and baseband are also test effects on magnetometers</span></p><p><b><span>Battery:</span></b></p><p><span>The module is mainly used to test battery related parameters, such as the percentage of residual power before and after the test, the current battery voltage and the temperature of Gasgue (energy management unit).&nbsp;</span></p><p><b><span>Torch and CL-200A:</span></b></p><p><span>CL-200A is mainly used to measure whether the color temperature of two modes of torch (cool white torch and amber white torch) is within the normal range. The machine CL-200A sends commands to the machine, and the machine returns a series of values from which the colorimetric measurement values are read. The module will also test the current value of two modes of torch and judge whether it is within the specified range.</span></p></p>',3,14),(32,'Magnet-Hall_KB','Introduction','This station simulates the intelligent keyboard in reality. The difference \nbetween it and hall is that the magnet position of the back cover is different.',NULL,14),(33,'Magnet-HSG','Introduction','Part of magnet Hall, it mainly tests whether the magnet magnetism of unit rear \ncover distribution is in a reasonable range.',NULL,14),(34,'Magnet HSG','Introduction','Part of magnet Hall, it mainly tests whether the magnet magnetism of unit rear \ncover distribution is in a reasonable range.',NULL,14),(35,'Magnet-Hall_LC','Introduction','This station simulates the protective sleeve in reality, mainly to measure the \nHall effect sensor, check the distance that the magnet (attached to the motor in \nthe fixture) slowly approaches / away from the Hall effect sensor, and whether \nthe distance when the Hall effect sensor is triggered or released is within the \ngiven range.(Similarly, the test station also needs to use the fixture, which \nwill detect the state of the screen when the protective cover is opened and \nclosed).',0,14),(36,'Magnet-Hall_LC','Calibration section of magnet Hall','Calibration data (verification of the magnetic induction intensity value of \norganic and inorganic stations)<br>Use stage: at the beginning of each \nbuild<br>Storage method: /vault/CalibrationData.txt<br>Reading method: the \ntraversal method is stored in SensorOffsetTable［］<br>How to use: Use 10 machines \nto inspect 10 times and take the average value<br>formula:<br>tempNum = (average \nvalue -1500)/(organic unit value-inorganic unit value)<br>teslaValue (final \nmagnetic pole value) = (tempNum * (inorganic station value-current magnetic pole \nvalue))/12.5',1,14),(37,'Magnet-Hall_LC','Motor section of Magnet-Hall','1： Motor initialization -- &gt; motorinit() function<br>2、 Calculate the \ndistance between motor and machine --- &gt; getpositionsensordistance ()<br>3： \nThe command of moving motor and the end mark -- &gt; movemotorwithcmd ()<br>4： \nInitialize the distance between the motor and the machine --- &gt; \ninitmotorposition ()<br>5： Calculate the distance and angle between the magnet \nand the release table.',2,14),(38,'QT2','Introduction','Access control test: after the end of the test, each station will write the \ncorresponding control bit of the station into the memory of MLB. Write P for \npass, f for fail, I (incomplete) for incomplete test, u (UN test) for UN test, \nRead the control bits of each station stored in the memory after the test \nthrough the test software. If all of them are pass, it means that all stations \nhave passed the test normally. If the control bit is u or I, it is necessary to \nreturn to the corresponding station for test, and failure shall be analyzed and \nmaintained. Due to the influence of test environment and test method, there may \nbe false test on the machine. In order to prevent the machine with unstable \nperformance from flowing out, Apple has set up such a program in the test \nsoftware: after three consecutive failed tests, the machine time will reset. \nThis means that when the station is tested again, the PDCA cannot be uploaded \nand the control bit cannot be written at the end of the test. In this way, the \ncberase command is used to clear the control bit of a single station, and the \ntime is modified to the current time, so that the machine can retest.<br>This \nstation. After the machine of production line fail enters maintenance, it is \nnecessary to clear the control position of FATP station.',NULL,14),(39,'QT2','The main test module as below:','<p></p><p><font face=\"微软雅黑\"><font size=\"2\"><b>iPort(Fixture):</b></font></font></p><p><font face=\"微软雅黑\"><font size=\"2\">In the shutdown state, the resistance of resistance, \ninductance and capacitance to alternating current in the test circuit is \ncollectively referred to as impedance.</font></font></p><p><font face=\"微软雅黑\"><font size=\"2\"><b>Jasper &amp; Pearl(QN&amp;QF):</b></font></font></p><p><font face=\"微软雅黑\"><font size=\"2\">Check \nthe status of the front and rear camera modules.</font></font></p><p><font face=\"微软雅黑\"><font size=\"2\"><b>Sim Card Test &amp; \nSim Tray Test(</b></font></font><b>QN&amp;QF</b><b>):</b></p><p><font face=\"微软雅黑\"><font size=\"2\">Detect whether Sim Tray or Sim Card is installed according \nto unit model.(Unit model: 3G or Wifi.)</font></font></p><p><font face=\"微软雅黑\"><font size=\"2\"><b>All CB Check:</b></font></font></p><p><font face=\"微软雅黑\"><font size=\"2\">Process \ncontrol.&nbsp;</font></font><span>Check the CB status of each station, whether there is failure or \nmissing measurement.</span></p><p><b>Notice</b>:QQ Jasper &amp; Pearl and SIM card test &amp; SIM tray are not tested.</p><p></p>',NULL,14),(42,'CG-QT','Introduction','<p class=\"MsoNormal\"><span>Station CG-QT0 is located in the sub stages, only TM is used. The test needs to use a fixture, and the main board of dut is fixed in the fixture, the sn of dut is the sn of the screen, not the sn of MLB, so this station has no control bit. The first test after each Overlay update needs to use kylin to verify the value of Tesla.</span><span><o:p></o:p></span></p>',NULL,14),(43,'CG-QT','The main test module as below:','<p class=\"MsoNormal\">&nbsp;<b>Grape</b>:</p><p class=\"MsoNormal\">Test whether normal data transmission can be completed between Grape and MLB (main logic board).</p><p class=\"MsoNormal\"><b>Pearl</b>:&nbsp;</p><p class=\"MsoNormal\">The proximity sensor detects the distance between the man and the machine to test whether the pearl module is normal.</p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><b>Hall</b>:</p><p class=\"MsoNormal\">Check whether the function of the hall sensor is normal through the change of the GPIO IRQ pin value when the electromagnet is not energized and energized.</p><p class=\"MsoNormal\"><b>Magnet</b>:&nbsp;</p><p class=\"MsoNormal\">Read the values of the four Teslas, and perform calculations between the read values and the values obtained during kylin check, and judge whether the values obtained after the calculations are within the required range.</p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><b>Opticalsensor</b>:&nbsp;</p><p class=\"MsoNormal\">Through the lighting of the fixture, it is detected whether the data received by the chip is within a given range when different ambient light irradiates the screen sensor chip.</p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><b>Display</b>:</p><p class=\"MsoNormal\">&nbsp;Check if there is a problem with the DUT screen. Such as foreign matter, contamination, broken screen, bright spot, white spot, splash screen, etc.<o:p></o:p></p>',NULL,14),(44,'FOS','Introduction','<p class=\"MsoNormal\"><span>Station FOS mainly tests whether the DUT screen has light leakage, bright spots, uneven color and chromatic aberration, and whether the camera can be turned on normally. Because the screen is an important part of the product, the worker has no fixtures, which is relatively simple but essential.</span><span><o:p></o:p></span></p>',NULL,14),(45,'FOS','The main test module as below:','<p class=\"MsoNormal\"><b>Battery<span>:&nbsp;</span></b></p><p class=\"MsoNormal\">This module is mainly used to test whether the voltage/current/temperature data of the battery is normal before and after testing the pattern and camera.</p><p class=\"MsoNormal\"><b>Pattern<span>:&nbsp;</span></b></p><p class=\"MsoNormal\">Check if there is a problem with the DUT screen. Such as foreign matter, contamination, broken screen, bright spot, white spot, splash screen, etc.</p><p class=\"MsoNormal\"><b>Camera(QN&amp;QF)<span>:&nbsp;</span></b></p><p class=\"MsoNormal\">Test whether each camera of DUT can be turned on normally, and whether the function of the camera is normal.</p><p class=\"MsoNormal\"><b>Backlight(QQ):</b>&nbsp;</p><p class=\"MsoNormal\">Test whether the screen leaks light by lighting ten groups of lights on one side of the screen, each of four groups.</p>',NULL,14),(46,'CT2','Introduction','<p class=\"MsoNormal\"><span>CT2 is the station that to validate connectivity after assembling Housing(HSG) and Top Module(TM) without fixture. The test content of this station mainly includes camera connectivity test, TM and HSG color matching test, Phosphrous chip material and function inspection, Grape related tests and Pearl tests. For 3G units, the installation and function of Sim tray and Sim card should also be tested. Before and after these functional tests, it must be ensured that the battery status is not abnormal.</span><span><o:p></o:p></span></p>',NULL,14),(47,'QT1','sadfsf','dfgdghfhfg',NULL,20),(48,'CT2','The main test module as below:','<p class=\"MsoNormal\"><span><b>TM &amp; HSG color:</b></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>The test will confirm the color of TM &amp; HSG according to the comparison of EEEE (</span><span>Engineering Configuration code)</span><span>&nbsp;and match with its color. Each project can have its own unique color, and each color can also correspond to multiple EEEEs.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span><b>camera:</b></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>QN &amp; QF</span><span>&nbsp;project &nbsp;both have five cameras, respectively are : Front Camera, Rear Camera, Juliet (includes Titus), Ohio and Jasper. The test will first find them and then check their NVM(Including some component Vendor check，Revision check and some numerical verifications). Finally, Check the connectivity of the cameras and MLB(Main Logic Board) .</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>QQ</span><span>&nbsp;</span><span>Project</span><span>&nbsp;</span><span>only</span><span>&nbsp;have Front Camera and Rear Camera. The test will first find them and then check their NVM(Including some component Vendor check，Revision check and some numerical verifications). Finally, Check the connectivity of the cameras and MLB(Main Logic Board) .</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span>Grape:</b></p><p class=\"MsoNormal\"><span>Every project is indispensable for Grape(Touch Panel) related tests. In addition to the basic connectivity and firmware version check, the coupling capacitance value between the drive line and the sense line will be read to check whether there is a short circuit between each drive line or each sense line, and determine whether the data transmission between the touch screen and the MLB is normal according to the amplitude and phase. Pressing the Grape will cause the capacitance value to change and affect the test result. Therefore, avoid contact with the units during the test to reduce the impact on the test.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b>PressureSensor and Pearl:</b></p><p class=\"MsoNormal\"><span>PressureSensor and Pearl modules are mostly tested by reading values </span><span>​​</span><span>to check whether their functions are normal.</span><span><o:p></o:p></span></p>',NULL,14),(51,'Scorpius Test','Introduction','<p>Scorpius Test is to test iPad wireless charge performance. The station use two \ncoupling coil to simulate iPad and Apple Pencil charge system and test if charge \nperformance is in spec. The station test at open loop, we need send command to \nIPad and Ginger.<br>The principle of wireless charge to use electromagnetism \ninduction(near filed induction) to accomplish power transfer from TX to RX.</p>',NULL,14),(52,'Scorpius Char','Introduction','<p>Scorpius Char is DOE station to simulate iPad and Apple Pencil system, but the \nstation is more accurate than Scorpius Test. The station use Robot to control RX \ncoil and test charge performance at Knom, Kmin and Kmax location. The station \ntest at Close loop, we control battery simulator to specify voltage, iPad will \ndetect the voltage and enter different power transfer speed \naccordingly(10C,3C,0.1C)<br></p>',NULL,14),(53,'Scorpius Touch','Introduction','<p class=\"MsoNormal\"><font size=\"2\" face=\"微软雅黑\">Basic test logic is to run \nbaseline first, then run virus and check if module noise is in spec.<br>Take \nTouch&nbsp;&nbsp;Coex for example, we run Touch as baseline, then run Scorpius and run \nTouch together, to check if Scorpius have effect on Touch.</font></p>',NULL,14),(54,'CT1','Introduction','<p class=\"MsoNormal\"><span>CT1 is a station with fixture for testing connectivity of dut after assembling HSG and TM.This station mainly tests the parameters of the battery before and after the test,does the information provided by SFC match the information in the unit. And check whether the materiel is replaced during the test and whether the components are assembled for abnormalities.</span>Calculating the average and standard deviation of accelerate, gyro and compass. And check the version of compass, the number of output data per second after calculation, and CRC (Cyclic Redundancy Check) for compass.&nbsp;</p>',NULL,14),(55,'CT1','The main test module as below:','<p class=\"MsoNormal\"><b>Pearl module:</b></p><p class=\"MsoNormal\"><span>The Pearl module obtains the values of parameters in the pearl module without occlusion.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b>opticalsensor module:</b></p><p class=\"MsoNormal\"><span>The opticalsensor module obtains the device ID, version ID, chip ID and the average value of each channel of the optical sensor, where different channels represent different colors of light.</span></p><p class=\"MsoNormal\"><b>hall module:</b></p><p class=\"MsoNormal\">The hall module tests whether the DUT can detect it by simulating the magnet switch through the fixture. Mic module test to get the value of Peak Magnitude and DC Magnitude at different positions after sound or mute. And calculate the difference of the corresponding position peak value or DC Magnitude.</p><p class=\"MsoNormal\"><b>button module:</b></p><p class=\"MsoNormal\">The button module uses the fixture to simulate the pressing force of power button, volume up / down button under the two functions of PMU（Power management unit) button and button.</p><p class=\"MsoNormal\"><b>Orion(QN&amp;QF):</b></p><p class=\"MsoNormal\">For Orion, the input and output modes of unit and external keyboard are realized by fixture and unit, and the values of current, voltage and other parameters in the two modes are obtained. And check the status of the three points at the connection to ensure that the module has been installed and not contaminated.</p><p class=\"MsoNormal\"><b>3G unit(QQ):</b></p><p class=\"MsoNormal\"><span>For 3G unit ,needing test Mesa module.This part tests fingerprint unlocking, including whether the color of the mesa button is consistent with that of HSG, comparing the mesa sn in the unit with that in SFC, &nbsp;and whether the unit can detect when simulating fingerprint unlocking with fixture.&nbsp;</span></p>',NULL,14),(56,'QT0a','The main test module as below:','<p class=\"MsoNormal\"><b><span>Basic:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>The Spartan environment, enter the diag mode, read the SN, get the Diags version, connect to the SFC (record all the status and information of the manufactured machines and materials, and get them through key values), the boardID of MLB can be used to judge 3G(Card) and WIFI, read battery status, version, temperature, number of charge ,current and voltage.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>DUTinfo :</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>The comparison of each SN and configuration. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Process:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This part is mainly for Mac address checking. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>System:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This part is mainly I2C communication detection. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Hall:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is the detection of magnetism. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>OpticalSensor:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module mainly tests the device ID, Revision ID, chip ID, and the average value of each channel of the light sensor. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Jasper(QN&amp;QF):</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is an infrared face recognition test. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Orion</span></b><b>(QN&amp;QF)</b><b>:</b></p><p class=\"MsoNormal\"><span>This module is about the connectivity test of the keyboard.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Scorpius:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is mainly for the connection and performance test of the charging pen. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Button:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is to test the power and volume buttons. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>SPK&amp;Mic:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This modules are for speaker and microphone testing. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Penrose:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This modules are mainly photosensitivity tests. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Strobe:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is mainly for flash mode testing.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>LDCM</span></b><b>(QN&amp;QF)</b><b>:</b></p><p class=\"MsoNormal\"><span>This module is mainly to test the connectivity of I/O.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b>Notice:</b>QQ&nbsp;Jasper<b> </b>,Orion&nbsp;and&nbsp;LDCM are not tested.</p>',1,14),(57,'QT0','Introduction','<p>Quick Test 0 (QT0) is the station between Pre-SWDL and RAT. It mainly tests whether the I/O port can be switched to various modes normally, whether all key functions are normal, whether the internal and external MIC, SPK, and HP can work normally after initialization (including whether the channel can transmit signals normally, and whether the components can work normally. Sound-to-electricity, electro-acoustic conversion, whether it is possible to control sound effect switching through remote keys), etc.</p>',NULL,14),(58,'QT0','The main test module as below:','<p class=\"MsoNormal\"><b>Basic:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">The Spartan environment, enter the diag mode, read the SN, get the Diags version, connect to the SFC (record all the status and information of the manufactured machines and materials, and get them through key values), the boardID of MLB can be used to judge 3G(Card) and WIFI, read battery status, version, temperature, number of charge ,current and voltage.<o:p></o:p></p><p class=\"MsoNormal\"><b>DUTinfo :</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">The comparison of each SN and configuration.<o:p></o:p></p><p class=\"MsoNormal\"><b>Process:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This part is mainly for Mac address checking.<o:p></o:p></p><p class=\"MsoNormal\"><b>System:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This part is mainly I2C communication detection.<o:p></o:p></p><p class=\"MsoNormal\"><b>Hall:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This module is the detection of magnetism.<o:p></o:p></p><p class=\"MsoNormal\"><b>OpticalSensor:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This module mainly tests the device ID, Revision ID, chip ID, and the average value of each channel of the light sensor.<o:p></o:p></p><p class=\"MsoNormal\"><b>Jasper:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This module is an infrared face recognition test.<o:p></o:p></p><p class=\"MsoNormal\"><b>Orion:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This module is about the connectivity test of the keyboard.<o:p></o:p></p><p class=\"MsoNormal\"><b>Scorpius:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This module is mainly for the connection and performance test of the charging pen.<o:p></o:p></p><p class=\"MsoNormal\"><b>Button:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This module is to test the power and volume buttons.<o:p></o:p></p><p class=\"MsoNormal\"><b>SPK&amp;Mic:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This modules are for speaker and microphone testing.<o:p></o:p></p><p class=\"MsoNormal\"><b>Penrose:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This modules are mainly photosensitivity tests.<o:p></o:p></p><p class=\"MsoNormal\"><b>Strobe:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This module is mainly for flash mode testing.<o:p></o:p></p><p class=\"MsoNormal\"><b>LDCM:</b><b><o:p></o:p></b></p><p class=\"MsoNormal\">This module is mainly to test the connectivity of I/O.<o:p></o:p></p><p class=\"MsoNormal\"><b>Notice:</b>QQ&nbsp;Jasper<b>&nbsp;</b>,Orion&nbsp;and&nbsp;LDCM are not tested.</p>',NULL,14),(59,'Gatekeeper','Introduction','<p>Access control test: after the end of the test, each station will write the corresponding control bit of the station into the memory of MLB. Write P for pass, f for fail, I (incomplete) for incomplete test, u (UN test) for UN test, Read the control bits of each station stored in the memory after the test through the test software. If all of them are pass, it means that all stations have passed the test normally. If the control bit is u or I, it is necessary to return to the corresponding station for test, and failure shall be analyzed and maintained. Due to the influence of test environment and test method, there may be false test on the machine. In order to prevent the machine with unstable performance from flowing out, Apple has set up such a program in the test software: after three consecutive failed tests, the machine time will reset. This means that when the station is tested again, the PDCA cannot be uploaded and the control bit cannot be written at the end of the test. In this way, the cberase command is used to clear the control bit of a single station, and the time is modified to the current time, so that the machine can retest.<br>This station. After the machine of production line fail enters maintenance, it is necessary to clear the control position of FATP station.</p>',NULL,14),(60,'Gatekeeper','The main test module as below:','<p><font face=\"微软雅黑\"><font size=\"2\"><b>iPort(Fixture):</b></font></font></p><p><font face=\"微软雅黑\"><font size=\"2\">In the shutdown state, the resistance of resistance, inductance and capacitance to alternating current in the test circuit is collectively referred to as impedance.</font></font></p><p><font face=\"微软雅黑\"><font size=\"2\"><b>Jasper &amp; Pearl:</b></font></font></p><p><font face=\"微软雅黑\"><font size=\"2\">Check the status of the front and rear camera modules.</font></font></p><p><font face=\"微软雅黑\"><font size=\"2\"><b>Sim Card Test &amp; Sim Tray Test:</b></font></font></p><p><font face=\"微软雅黑\"><font size=\"2\">Detect whether Sim Tray or Sim Card is installed according to unit model.(Unit model: 3G or Wifi.)</font></font></p><p><font face=\"微软雅黑\"><font size=\"2\"><b>All CB Check:</b></font></font></p><p><font face=\"微软雅黑\"><font size=\"2\">Process control.&nbsp;</font></font>Check the CB status of each station, whether there is failure or missing measurement.</p><p><b>Notice</b>:QQ Jasper &amp; Pearl and SIM card test &amp; SIM tray are not tested.</p>',NULL,14),(61,'CT3','Introduction','<p class=\"MsoNormal\"><span>CT3 is a offline station,It is mainly to test whether the connectivity of all the key functions after pressing is normal, whether the screen display and light sensor display are normal, and collect all data and upload them to insight for analysis。</span></p>',NULL,14),(62,'CT3','The main test module as below:','<p class=\"MsoNormal\"><span><b>Battery&nbsp;</b></span><span><o:p></o:p></span><b>Module:</b></p><p class=\"MsoNormal\"><span>Monitor the battery condition before and after the test. In addition, thermistor (used to test battery NTC, as charge and discharge parameters) and temperature switch (thermostat: used to detect the temperature of battery pack, as a forced protection switch for battery abnormality)。</span></p><p class=\"MsoNormal\"><b>Button、Orion&nbsp;</b><b>Module(QQ):</b></p><p class=\"MsoNormal\"><span>Test the functionality of the power supply</span><span>,</span><span>&nbsp;volume up and down buttons</span><span>,</span><span>&nbsp;and the functionality of the external keyboard three copper points</span><span>。</span></p><p class=\"MsoNormal\"><span><o:p></o:p></span><span>Orion Module is not tested in QQ projects。In QQ project, the power button is also tested on three points, left, middle and right。</span></p><p class=\"MsoNormal\"><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b>Grape Module:</b></p><p class=\"MsoNormal\"><span>System input device, iPad series products use IPS multi touch capacitive touch screen. By touching the icon of human-computer interface with your finger, the control system makes corresponding response (such as camera, playing music, making phone calls, etc.). The capacitive touch screen uses indium tin oxide layer as its working layer. At the working level,The upper and lower surfaces are covered with glass. In order to reduce the reflection of the glass to LCD light, the glass screen is usually coated with a layer of transparent anti reflection film. The capacitive touch screen is plated with a long and narrow motor around the panel to form a low-voltage AC electric field in the conductive body. When the user touches the panel, due to the electric field of the human body,A coupling capacitance is formed between the finger and the conductive layer. Then, the current from the four sides of the electrode flows to the contact, and its strength is proportional to the distance between the finger and the electrode. The controller can calculate the contact position accurately by calculating the current proportion and strength.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b>Acclelerometer，Gyro&nbsp;</b><b>Module:</b></p><p class=\"MsoNormal\"><span>The acceleration sensor is used for basic attitude recognition and environment perception. The tilt angle and gravity acceleration value of iPad are calculated by sensing the angle of X, y, Z three axes or any two axes by accelerometer, so as to measure the current acceleration and gravity gravity gravity of iPad. Combined with the program, the screen picture changes with the machine state. In addition, according to the measured acceleration, combined with the initial GPS speed, the current speed and moving distance can be calculated. In addition, the turning information and slope size measured by the gyroscope can be used to achieve full range&nbsp;</span><span>endurance in the GPS blind area. The main function of the gyroscope is to assist the iPad in the GPS signal blind area to achieve continuous navigation.</span></p><p class=\"MsoNormal\"><b><span>Mesa Module(QQ)</span><span>：</span></b></p><p class=\"MsoNormal\"><span>Mesa module is mainly used to test fingerprint identification function. It tests the power key of the machine. When the fixture presses the power key, it can see whether the machine can recognize whether it has been triggered. This module function is only available in QQ project.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><br></p>',NULL,14),(63,'QT0a_REL','Introduction','<p class=\"MsoNormal\"><span>REL Quick Test 0(QT0_REL) is the station for DQE rel line,which guarantees product’s reliability after several physical intervention experiment.It mainly tests whether the I/O port can be switched to various modes normally, whether all key functions are still normal, whether the internal and external MIC, SPK, and HP can still work normally after initialization (including whether the channel can transmit signals normally, and whether the components can work normally. Sound-to-electricity, electro-acoustic conversion, whether it is possible to control sound effect switching through remote keys), etc.</span><span><o:p></o:p></span></p>',0,14),(64,'QT0a_REL','The main test module as below:','<p class=\"MsoNormal\"><b><span>Basic:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>The Spartan environment, enter the diag mode, read the SN, get the Diags version, connect to the SFC (record all the status and information of the manufactured machines and materials, and get them through key values), the boardID of MLB can be used to judge 3G(Card) and WIFI, read battery status, version, temperature, number of charge ,current and voltage.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>DUTinfo :</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>The comparison of each SN and configuration. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Process:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This part is mainly for Mac address checking. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>System:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This part is mainly I2C communication detection. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Hall:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is the detection of magnetism. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>OpticalSensor:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module mainly tests the device ID, Revision ID, chip ID, and the average value of each channel of the light sensor. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Jasper:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is an infrared face recognition test. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Orion:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is about the connectivity test of the keyboard.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Scorpius:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is mainly for the connection and performance test of the charging pen. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Button:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is to test the power and volume buttons. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>SPK&amp;Mic:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This modules are for speaker and microphone testing. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Penrose:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This modules are mainly photosensitivity tests. </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>Strobe:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is mainly for flash mode testing.</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>LDCM:</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>This module is mainly to test the connectivity of I/O.</span><span><o:p></o:p></span></p>',1,14),(65,'ALS-SPK DOE','Introduction','<p><font color=\"#2f2f2f\">ALS SPK DOE is for testing speaking aperture light leakage, \nin where install C1 ALS sensor. The testing module of this station is divide \ninto two parts, they are: 1)C1 CFSN calculation 2) CRE calculation.</font></p>',NULL,14),(66,'ALS-SPK DOE','The main test module as below:','<p><p><font color=\"#2f2f2f\"><b>C1 CFSN calculation:</b>&nbsp;</font></p><p><font color=\"#2f2f2f\">We read device_id, rev_id, chip_id, \nadd_id1 and add_id2 from EEPROM, splicing them together as a unit special C1 \nsensor identified CFSN.</font></p><br><p><font color=\"#2f2f2f\"><b>CRE calculation:</b>&nbsp;</font></p><p><font color=\"#2f2f2f\">CRE \nis calculated based on devision of both channel ratio and only channel ratio, \nratio is normalized by channel3 value. </font></p><br><font color=\"#2f2f2f\">those \ntwo values are collected by apple engineer for data analysis, lead to possible \nassemble justification.&nbsp;</font></p>',NULL,14),(67,'IQC-Current','Introduction','<p>The purpose of the station is to test the topmoudle, and get the current value \nof the topmoudle under each color module by running the specified script.</p>',NULL,14),(68,'IQC-FOS','Introduction','<p>The purpose of the work station is to test the topmoudle and observe whether the \ntopmoudle display is abnormal under different color modules.</p>',NULL,14),(69,'RxCL','Introduction','<p><font face=\"微软雅黑\"><font size=\"2\">Unit can’t be tested in diags mode, only be tested \nin NonUI mode, RxCL station is mainly used to write key values ​​such as \nRxCL,MtDo and so on.</font></font></p>',NULL,14),(70,'LCMSN Truncation','Introduction','<p><font face=\"微软雅黑\"><font size=\"2\">The size of LCM SN is about 70 or 80, when the \nunits is ready to be shipped, we need LCM SN length 17, then the shipping \nstation can test pass.<br></font></font></p>',NULL,14),(71,'USBC_Test_DOE','Introduction','<p><font size=\"2\" face=\"微软雅黑\">Purple Restore which can detect DFU/Recovery mode + \noverlay record SN, pass/fail, test time to insight</font></p>',NULL,14),(72,'LCM-BURN','Introduction','<p><font face=\"微软雅黑\"><font size=\"2\">Unit can’t be tested in diags mode, only be tested \nin NonUI mode, RxCL station is mainly used to write key values ​​such as \nRxCL,MtDo,LCM SNand so on.</font></font></p>',NULL,14),(73,'Jasper Arming','Introduction','<p><font size=\"2\" face=\"微软雅黑\">The station is check Jasper\'s arming status in OS test \nmode.Get some calculated values by calling the Python file in the machine and \nget projector compliance.The machine flows in from the last station, \ncommunicates with telnet and tcprelay, enters the OS login status and reads SN \nto start the test.In the final stage of the test, the machine enters the diag \nmode from OS and writes to Jasper CB, then restarts the machine and packages the \ntest data to insight.</font></p>',NULL,14),(74,'Scorpius Audio','Introduction','<p>Basic test logic is to run baseline first, then run virus and check if module \nnoise is in spec.<br>Take Touch&nbsp;&nbsp;Coex for example, we run Touch as baseline, \nthen run Scorpius and run Touch together, to check if Scorpius have effect on \nTouch.</p>',NULL,14),(75,'Scorpius DOE','Introduction','<p>Basic test logic is to run baseline first, then run virus and check if module \nnoise is in spec.<br>Take Touch&nbsp;&nbsp;Coex for example, we run Touch as baseline, \nthen run Scorpius and run Touch together, to check if Scorpius have effect on \nTouch.</p>',NULL,14),(76,'Scorpius CPU','Introduction','<p>Basic test logic is to run baseline first, then run virus and check if module \nnoise is in spec.<br>Take Touch&nbsp;&nbsp;Coex for example, we run Touch as baseline, \nthen run Scorpius and run Touch together, to check if Scorpius have effect on \nTouch.</p>',NULL,14),(77,'Scorpius Camera','Introduction','<p>Basic test logic is to run baseline first, then run virus and check if module \nnoise is in spec.<br>Take Touch&nbsp;&nbsp;Coex for example, we run Touch as baseline, \nthen run Scorpius and run Touch together, to check if Scorpius have effect on \nTouch.</p>',NULL,14),(78,'Scorpius Jasper','Introduction','<p>Basic test logic is to run baseline first, then run virus and check if module \nnoise is in spec.<br>Take Touch&nbsp;&nbsp;Coex for example, we run Touch as baseline, \nthen run Scorpius and run Touch together, to check if Scorpius have effect on \nTouch.</p>',NULL,14),(79,'Scorpius Display','Introduction','<p>Basic test logic is to run baseline first, then run virus and check if module noise is in spec.<br>Take Touch&nbsp;&nbsp;Coex for example, we run Touch as baseline, then run Scorpius and run Touch together, to check if Scorpius have effect on Touch.</p>',NULL,14),(80,'QT5','Introduction','<p class=\"MsoNormal\"><span>The QT5 station is used to check whether the jasper cable is cut off on the DUT. If the jasper cable is cut off on the DUT, you need to check the status of the station CB.</span></p>',NULL,14),(81,'QT3','Introduction','<p class=\"MsoNormal\"><span>The QT3 station is used to test whether the cable of the pearl module is cut off on the DUT.</span></p>',NULL,14),(82,'Mag-Hall（SC）','Introduction','<p>Same as online magnet-hall station</p>',NULL,14),(83,'Mag-Hall（KB1）','Introduction','<p>This station simulates the intelligent keyboard in reality. The difference \nbetween it and hall is that the magnet position of the back cover is \ndifferent(This station is a DOE station).</p>',NULL,14),(84,'Mag-Hall（KB2）','Introduction','<p>This station simulates the intelligent keyboard in reality. The difference \nbetween it and hall is that the magnet position of the back cover is \ndifferent(This station is a DOE station).</p>',NULL,14),(85,'IQC MLB','Introduction','<p><font size=\"2\" face=\"微软雅黑\">The purpose of the work station is to test the topmoudle \nand observe whether the topmoudle display is abnormal under different color \nmodules.Get the scanned Sn,SrNm and MLB# from unit and put them into station \ncomputer file.Put the picture files from the computer into the unit.<br></font></p>',NULL,14);
